import React from 'react'

export default class TeamSelector extends React.Component {

    getTeamsList() {
        var teams = [];
        teams.push(<option key='1' value='Paris St Germain'/>);
        teams.push(<option key='2' value='Olympique Lyonnais'/>);
        teams.push(<option key='3' value='AS Monaco'/>);
        return teams;
    }

    render() {
        return(
            <div className='team-selector'>
                <p>Team 1</p>
                <select i='select1'>
                    {this.getTeamsList()}
                </select>
            </div>
        )
    }
}
